import React from 'react';

const Navigation = () => {
  return (
    <nav>
      <a href="#">Home</a>
      <a href="#">Products</a>
      <a href="#">About Us</a>
      <a href="#">Contact Us</a>
    </nav>
  );
}

export default Navigation;
